         break;
      }

      loadLibraryAddr = GetProcAddress(hKernel32, "LoadLibraryA");
      if (NULL == loadLibraryAddr)
      {
         _tprintf(_T("[-] Failed to get LoadLibraryA address, error = %d\n"), GetLastError());
         break;
      }

      remoteString = VirtualAllocEx(hProcess, NULL, strlen(dllName) + 1, MEM_COMMIT, PAGE_READWRITE);
      if (NULL == remoteString)
      {
         _tprintf(_T("[-] Failed to allocate memory in remote process, error = %d\n"), GetLastError());
         break;
      }

      if (!WriteProcessMemory(hProcess, remoteString, (LPVOID)dllName, strlen(dllName) + 1, NULL))
      {
         _tprintf(_T("[-] Failed to write dll path in remote process, error = %d\n"), GetLastError());
         break;
      }

      hThread = CreateRemoteThread(hProcess, NULL, 0, (LPTHREAD_START_ROUTINE)loadLibraryAddr, remoteString, 0, &threadId);
      if (NULL == hThread)
      {
         _tprintf(_T("[-] Failed to create remote thread, error = %d\n"), GetLastError());
         break;
      }

      WaitForSingleObject(hThread, INFINITE);

      bSuccess = TRUE;

   } while (0);

   if (NULL != remoteString)
   {
      VirtualFreeEx(hProcess, remoteString, strlen(dllName) + 1, MEM_RELEASE);
   }

   if (NULL != hThread)
   {
      CloseHandle(hThread);
   }

   if (NULL != hProcess)
   {
      CloseHandle(hProcess);
   }

   return bSuccess;
}

